import React, { useRef, useState } from "react";
import { Link } from "react-router-dom";
import { Button, Popover, OverlayTrigger } from "react-bootstrap";


export default function HowItWorks() {  

  const popover = (
    <Popover id="popover1">
      <Popover.Title as="h3">Popover right</Popover.Title>
      <Popover.Content>
        And here's some <strong>amazing</strong> content. It's very engaging.
        right?
      </Popover.Content>
    </Popover>
  );

  // const Example = () => (
  //   <OverlayTrigger trigger="click" placement="right" overlay={popover}>
  //     <Button variant="success">Click me to see</Button>
  //   </OverlayTrigger>
  // );

  // const Example = () => (
  //   <OverlayTrigger   
  //    placement="right" 
  //    trigger="hover" 
  //    key="overlay-1"
  //    overlay={<Popover id="popover1" title="Popover right">Test</Popover>}
  //   >
  //   </OverlayTrigger>
  // );


  return (
    <div className="center">
    <img src={require("./architecture3.png")}
         alt="App architecture" 
  class="center"
        width="1588" 
        height="1124" 

         position="relative"
         usemap="#image-map" /> 
    <map name="image-map">
      <area position="relative" display="inline-block" z-index="1" target="_blank" alt="1" title="1" href="#popover1" coords="266,117,17" shape="circle" />
      <area target="_blank" alt="2" title="2" href="2" coords="494,397,21" shape="circle" />
      <area target="_blank" alt="3" title="3" href="3" coords="969,397,18" shape="circle" />
      <area target="_blank" alt="4" title="4" href="4" coords="1242,661,19" shape="circle" />
      <area target="_blank" alt="5" title="5" href="5" coords="968,518,19" shape="circle" />
      <area target="_blank" alt="6" title="6" href="6" coords="497,518,22" shape="circle" />
    </map>

    </div>
  )


  }





